apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  annotations:
    sealedsecrets.bitnami.com/namespace-wide: "true"
  name: server-env
  namespace: fce
spec:
  encryptedData:
    # EMAIL CONFIG
    MAIL_TRANSPORT_CONFIG: 

    # External API tokens
    API_GOUV_TOKEN: 
    API_SIRENE_BASIC_AUTH: 

    # Authentication email
    MAGIC_LINK_BCC: 
    MAGIC_KEY_ALLOWED_EMAILS: 

    # Auth
    JWT_SECRET: 
    JWT_EXPIRE: 
    JWT_TEMP_EXPIRE: 

    # Appsearch
    CREDENTIAL_API_KEY: 
    JWT_APPSEARCH_API_KEY: 

    # Feedback email
    MAIL_TO: 

    EMAIL_SALT: 

    # Matomo
    MATOMO_TOKEN_AUTH: 

    STRAPI_USERNAME: 
    STRAPI_PASSWORD: 

    ELASTIC_API_KEY: 

    API_TOKEN: 

    #BCE
    BCE_URL: 
    BCE_TOKEN: 

    # PROCONNECT
    PROCONNECT_CLIENT_ID: 
    PROCONNECT_CLIENT_SECRET: 
    PROCONNECT_REDIRECT_URI: 
    PROCONNECT_POST_LOGOUT_REDIRECT_URI: 
    PROCONNECT_URL_DISCOVER: 
    SESSION_SECRET: 
  
  template:
    metadata:
      annotations:
        sealedsecrets.bitnami.com/namespace-wide: "true"
      name: server-env
    type: Opaque
